import { BrowserRouter, Routes ,Route } from "react-router-dom";
import App from "./App";
import Home from "./page/Home";
import Introduction from "./page/Club/introduction";
import Vision from "./page/Club/vision";
import Organization from "./page/Club/organization";
import Emblem from "./page/Club/emblem";
import History from "./page/Club/history";
import Greeting from "./page/Club/greeting";
import Stadium from "./page/Club/stadium";
import Parking from "./page/Club/parking";
import '../src/css/import.css'
import Seat from "./page/Club/seat";

export default function Root() {
  return (
    <div id="bg-Black">
    <BrowserRouter>
        <Routes>
          <Route path="/" element={<App />}>
            <Route index  element={<Home />} />
            <Route path="club">
              <Route index element={<Introduction />} />
              <Route path="vision" element={<Vision />}/>
              <Route path="tel" element={<Organization />}/>
              <Route path="emblem" element={<Emblem />}/>
              <Route path="history" element={<History />}/>
              <Route path="greeting" element={<Greeting />}/>
              <Route path="stadium" element={<Stadium />}/>
              <Route path="parking" element={<Parking />}/>
              <Route path="seat" element={<Seat />}/>
            </Route>
          </Route>
        </Routes>
    </BrowserRouter>  
    </div>
  );
}
